require("dotenv").config();
const terminateListener = require("../terminate-listener.js");
const queue = require("../configure-queue.js");
const pool = require("../configure-db.js");
const redisClient = require("../configure-redis.js").promisifiedClient;
const uuid = require('uuid/v4');
const promiseAllSequential = require("promise-all-sequential");

queue.subscribe((msg, callback) => {
    const payload = JSON.parse(msg.toString());
    //const payload = {"ctx":"/","nameData":{"action":"next","firstname":"Jacob","lastname":"Heisterberg","email":"jacob@heisterberg.dk","optin":true},"answers":[{"answerid":"a031i000004wJ1OAAU","questionid":"a021i000002HbpjAAC","name":"question1","value":"A"},{"answerid":"a031i000004wJ1UAAU","questionid":"a021i000002HbpkAAC","name":"question2","value":"C"},{"answerid":"a031i000004wJ1YAAU","questionid":"a021i000002HbplAAC","name":"question3","value":"C"},{"answerid":"a031i000004wJ1dAAE","questionid":"a021i000002HbpmAAC","name":"question4","value":"D"}]};
    const answers = payload.answers.reduce((prev, answer) => {
        prev[answer.answerid] = answer;
        return prev;
    }, {});

    // get the questionnaire from redis
    redisClient.get(`questionnaire:${payload.ctx}`).then(data => {
        const questionnaire = JSON.parse(data);
        //const questionnaire ={"context":"/","questionnaireid":"a001i000002gzvGAAQ","versionid":"a011i0000054egrAAA","questions":[{"index":1,"id":"a021i000002HbpjAAC","correctAnswerId":"a031i000004wJ1OAAU","text":"How can Salesforce Success Cloud support you on your journey?","sorting":0,"imageRefId":"0EM1i000000Vi24","answers":[{"answerid":"a031i000004wJ1OAAU","questionid":"a021i000002HbpjAAC","text":"A","sorting":0},{"answerid":"a031i000004wJ1PAAU","questionid":"a021i000002HbpjAAC","text":"B","sorting":10},{"answerid":"a031i000004wJ1QAAU","questionid":"a021i000002HbpjAAC","text":"C","sorting":20},{"answerid":"a031i000004wJ1RAAU","questionid":"a021i000002HbpjAAC","text":"D","sorting":30}],"image":"data:image/png;base64,"},{"index":2,"id":"a021i000002HbpkAAC","correctAnswerId":"a031i000004wJ1TAAU","text":"What is the Danish Success Community?","sorting":10,"imageRefId":"0EM1i000000Vi2E","answers":[{"answerid":"a031i000004wJ1SAAU","questionid":"a021i000002HbpkAAC","text":"A","sorting":0},{"answerid":"a031i000004wJ1TAAU","questionid":"a021i000002HbpkAAC","text":"B","sorting":10},{"answerid":"a031i000004wJ1UAAU","questionid":"a021i000002HbpkAAC","text":"C","sorting":20},{"answerid":"a031i000004wJ1VAAU","questionid":"a021i000002HbpkAAC","text":"D","sorting":30}],"image":"data:image/png;base64,"},{"index":3,"id":"a021i000002HbplAAC","correctAnswerId":"a031i000004wJ1XAAU","text":"Where can you learn how to use Salesforce products, agile practices, and much more through guided learning paths and hands-on challenges?","sorting":20,"imageRefId":"0EM1i000000Vi2d","answers":[{"answerid":"a031i000004wJ1WAAU","questionid":"a021i000002HbplAAC","text":"A","sorting":0},{"answerid":"a031i000004wJ1XAAU","questionid":"a021i000002HbplAAC","text":"B","sorting":10},{"answerid":"a031i000004wJ1YAAU","questionid":"a021i000002HbplAAC","text":"C","sorting":20},{"answerid":"a031i000004wJ1ZAAU","questionid":"a021i000002HbplAAC","text":"D","sorting":30}],"image":"data:image/png;base64,"},{"index":4,"id":"a021i000002HbpmAAC","correctAnswerId":"a031i000004wJ1dAAE","text":"Which Salesforce technologies were used to build this app?","sorting":30,"imageRefId":"0EM1i000000Vi2x","answers":[{"answerid":"a031i000004wJ1aAAE","questionid":"a021i000002HbpmAAC","text":"A","sorting":0},{"answerid":"a031i000004wJ1bAAE","questionid":"a021i000002HbpmAAC","text":"B","sorting":10},{"answerid":"a031i000004wJ1cAAE","questionid":"a021i000002HbpmAAC","text":"C","sorting":20},{"answerid":"a031i000004wJ1dAAE","questionid":"a021i000002HbpmAAC","text":"D","sorting":30}],"image":"data:image/png;base64,"}]}
        
        // figure out what questions are correct        
        questionnaire.questions.forEach(question => {
            const correctAnswerId = question.correctAnswerId;
            let correct = false;
            question.answers.forEach(answer => {
                const actualAnswer = answers[answer.answerid];
                if (actualAnswer && correctAnswerId === actualAnswer.answerid) correct = true;
            })
            
            const providedAnswer = payload.answers.reduce((prev, answer) => {
                if (prev) return prev;
                if (answer.questionid === question.id) return answer
            }, undefined)

            // update question
            question.correct = correct;
            question.answerid = providedAnswer ? providedAnswer.answerid : undefined;
        })
        
        // log it
        console.log('-------');
        console.log(`${payload.nameData.firstname} ${payload.nameData.lastname} (${payload.nameData.email}, opt-in: ${payload.nameData.optin})`);
        questionnaire.questions.forEach(question => {
            console.log(`${question.index}. ${question.text}, correct: ${question.correct} (questionid <${question.id}>, answerid <${question.answerid}>)`);
        })
        console.log('-------');

        // generate uuid for questionnaire response external id
        const responseUuid = uuid();

        pool.query("BEGIN").then(rs => {
            // query for account
            return pool.query(`select sfid, external_id__c 
                from salesforce.account 
                where external_id__c='${payload.nameData.email}';`);

        }).then(rs => {
            // we're setting opt-out and have opt-in so reverse 
            const optout = payload.nameData.optin ? 'FALSE' : 'TRUE';
            if (rs.rows.length) {
                // found existing account so update it
                return pool.query(`UPDATE salesforce.Account SET firstname='${payload.nameData.firstname}', lastname='${payload.nameData.lastname}', PersonHasOptedOutOfEmail=${optout} 
                    WHERE PersonEmail='${payload.nameData.email}'`);
            } else {
                // no existing account so insert
                return pool.query(`INSERT INTO salesforce.Account 
                    (External_ID__c, PersonEmail, PersonHasOptedOutOfEmail, firstname, lastname, recordtypeid) 
                    VALUES 
                    ('${payload.nameData.email}', '${payload.nameData.email}', ${optout}, '${payload.nameData.firstname}', '${payload.nameData.lastname}', '${process.env.PERSONACCOUNT_RECORDTYPEID}');`);
            }

        }).then(rs => {
            // create response record
            return pool.query(`INSERT INTO salesforce.basecamp_questionnaire_response__c 
                (questionnaire__c, version__c, account__r__external_id__c, external_id__c) 
                VALUES 
                ('${questionnaire.questionnaireid}', '${questionnaire.versionid}', '${payload.nameData.email}', '${responseUuid}');`);

        }).then(rs => {
            // create a response answer per answer
            const promises = questionnaire.questions.map(q => {
                return pool.query(`INSERT INTO salesforce.basecamp_questionnaire_answer__c 
                    (questionnaire_response__r__external_id__c, answer__c, question__c, external_id__c, correct__c) 
                    VALUES 
                    ('${responseUuid}', '${q.answerid}', '${q.id}', '${uuid()}', ${q.correct ? 'TRUE' : 'FALSE'});`);
            });
            console.log(`Converted ${questionnaire.questions.length} questions into ${promises.length} promises`);
            return promiseAllSequential(promises);
            
        }).then(rs => {
            // commit
            return pool.query("COMMIT");

        }).then(rs => {
            // callback and acknowledge the processing of the msg
            callback();

        }).catch(err => {
            console.log(`Caught error (${err.message}) so rolling tx back`);
            return pool.query("ROLLBACK");
        })
    })
})

// setup termination listener
terminateListener(() => {
	console.log("Terminating services");
    queue.close();
    pool.end();
	console.log("Terminated services");
});
